    constructor(props){
        super(props);
        this.state={
            marks:''
        }
    }

    render(){

        return(
            <div class="image">
                <Mapimg />
                {}//this.props && this.props.data && this.props.data.map(obj=> <Marker key={obj.id_number} color='blue' x={obj.x*100+'%'} y={obj.y*100+'%'} name={obj.room_num+" "} id={obj.id_number + ''} />)}
            </div>
        )
    }
}
